      out.write("        var expireDate = new Date();\r\n");
      out.write("        expireDate.setDate(expireDate.getDate() - 1);\r\n");
      out.write("        document.cookie = cookieName + \"= \" + \"; expires=\" + expireDate.toGMTString();\r\n");
